query GetSessionsIdentifiers($zoneTag: string, $filter: any) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        apiGatewayMatchedSessionIDsAdaptiveGroups(
          limit: 1000
          filter: $filter
        ) {
          count
          dimensions {
            apiGatewayMatchedSessionIdentifierName
            apiGatewayMatchedSessionIdentifierType
            datetimeDay
          }
        }
      }
    }
  }

query TopSequencesOverview(
    $zoneTag: string
    $filter: ZoneApiRequestSequencesGroupsFilter_InputObject
  ) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        apiRequestSequencesGroups(
          limit: $limit
          filter: $filter
          orderBy: $orderBy
        ) {
          aggMax {
            timeLastUpdated
            timeLastSeen
          }
          aggArgMax {
            numOccurrences
            numOccurrencesPrefix
            numOccurrencesLast
            samplingFraction
            correlation
            operationsApiEndpoints
            operationsClientRequestHTTPMethods
          }
          dimensions {
            apiHost
            rank
          }
          uniq {
            rankCount
          }
        }
      }
    }
  }

query TopSequencesOverview(
    $zoneTag: string
    $filter: ZoneApiRequestSequencesGroupsFilter_InputObject
  ) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        apiRequestSequencesGroups(
          limit: 40
          filter: $filter
          orderBy: [rank_ASC]
        )
          @connection(
            key: "apiRequestSequencesGroupsEndMgmt"
            filter: ["filter", "orderBy"]
          ) {
          aggArgMax {
            operationsApiEndpoints
            operationsClientRequestHTTPMethods
          }
          dimensions {
            clientRequestHTTPHost
            rank
          }
        }
      }
    }
  }

query TopSequencesOverview(
    $zoneTag: string
    $filter: ZoneApiRequestSequencesGroupsFilter_InputObject
  ) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        apiRequestSequencesGroups(limit: $limit, filter: $filter) {
          dimensions {
            apiHost
          }
          uniq {
            rankCount
          }
        }
      }
    }
  }

query apiTrafficDistribution($zoneTag: string, $filter: filter) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        apiTraffic: httpRequestsAdaptiveGroups(limit: 2, filter: $apiFilter) {
          count
        }
        nonApiTraffic: httpRequestsAdaptiveGroups(limit: 100, filter: $filter) {
          count
        }
      }
    }
  }

